import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import LoginPage from "./pages/LoginPage/LoginPage"; // Importa la página de login
import NotFoundPage from "./pages/NotFoundPage/NotFoundPage"; // Página para rutas no encontradas

function App() {
  return (
    <Router>
      <Routes>
        {/* Ruta para el Login */}
        <Route path="/login" element={<LoginPage />} />


        {/* Redirección desde la raíz al login */}
        <Route path="/" element={<Navigate to="/login" />} />

        {/* Ruta por defecto para manejar rutas no encontradas */}
      </Routes>
    </Router>
  );
}

export default App;
